CREATE DEFINER=`root`@`localhost` PROCEDURE `LAY_QUAN_HUYEN`(
	in
		P_ID_QH int,
        P_ID_TTP int,
        P_TEN varchar(150)
)
BEGIN
	if P_ID_QH < 0 then
		select ID_QUAN_HUYEN,ID_TINH_TP,TEN_QUAN_HUYEN,ST_AsGeoJSON(POLYGON) as POLYGON
        from quan_huyen
        where if(P_ID_TTP<0, 1=1, ID_TINH_TP=P_ID_TTP)
			and TEN_QUAN_HUYEN like concat('%',P_TEN,'%');
    else 
		select ID_QUAN_HUYEN,ID_TINH_TP,TEN_QUAN_HUYEN,ST_AsGeoJSON(POLYGON) as POLYGON
        from quan_huyen
        where ID_QUAN_HUYEN=P_ID_QH;
    end if;
END ;;
